import React, { useState } from "react";
import style from "./Nav.module.css";

const Nav = () => {
  let navClass = "style.navLinks";
  const [isOpened, setIsOpened] = useState(false);

  const navSlide = () => {
    if (isOpened) {
      setIsOpened(false);
      navClass = "style.navLinks";
    } else {
      setIsOpened(true);
      navClass = "style.navLinks style.navActive";
    }
  };

  return (
    <nav>
      <div className={style.logo}>
        <h4>Ingredients</h4>
      </div>

      <ul className={style.navLinks}>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Work</a>
        </li>
        <li>
          <a href="#">Projects</a>
        </li>
      </ul>

      <div className={style.burger} onClick={navSlide}>
        <div className={style.line1}></div>
        <div className={style.line2}></div>
        <div className={style.line3}></div>
      </div>
    </nav>
  );
};

export default Nav;
